        "8","9","/",
        "4","5","6","*", 
        "1","2","3","-", 
        "0",".","C","+",
        "="
    ];

    const cal_buttons = caption.map((value, index) => {
        return <CalculatorButton caption={value}/>
    });

    return(
        <div className='calculator-grid-container'>
            <CalculatorDisplay/>
            {cal_buttons}
        </div>
    );
}

